import React from "react";

import './CreateAnnonce.css';

class CreateAnnonce extends React.Component {

    constructor(props){
        super(props);
        this.state = {
            currentCategory: '',
            currentSubs: []
        }
    }

    render(){
        var house = {
            name: "Enebolig",
            id: 4325,
            subs: [
                {title : "kiralik", desc: "kiralik ev"},
                {title : "satilik", desc: "satilik ev"},
                {title : "komple", desc: "komple ev"},
            ]
        }
        var car = {
            name: "Bil",
            id: 9876,
            subs: [
                {title : "benzinli", desc: "benzinli araba"},
                {title : "dizel", desc: "dizel araba"},
            ]
        }
        const categories = [
            house, car
        ]
        return(
            <div className="createAnnonceMainDiv">
                <div className="chooseMainCategoryDiv">
                    { categories.map(cat => (
                        <button type="button" className="btn border border-secondary">{cat.name}</button>
                    ))}
                </div>
                <div className="subCategoryDiv">
                    <select className="form-select" id="sortby-menu" style={{width: "200px"}}>
                        <option defaultValue value="publishedNew">Choose a sub cat</option>
                        {this.state.currentSubs(sub => {
                            <option value=""></option>
                        })}
                        <option value="publishedOld">Eldste først</option>
                        <option value="priceLowHigh">Pris lav-høy</option>
                        <option value="priceHighLow">Pris høy-lav</option>
                    </select>           
                </div>
                <button className="btn btn-primary">Choose</button>
                {console.log(categories[0]["subs"][0])}
            </div>
        )
    }
}

export default CreateAnnonce;
